import React, { useState } from 'react';
import TicTacToe from './TicTacToe';

const Games = () => {
  const [showGames, setShowGames] = useState(false);

  return (
    <div>
      <button onClick={() => setShowGames(!showGames)}>
        {showGames ? 'Hide Games' : 'Show Games'}
      </button>
      {showGames && <TicTacToe />}
    </div>
  );
};

export default Games;
